import React from 'react'
import productsa from '../products'
import {Row, Col} from 'react-bootstrap'
import Product from '../components/Product'

const HomeScreen = () => {
  return (
    <>
        <h1>Latest Products</h1>
        <Row>
            {productsa.map(pro=>( 

            <Col sm={8} md={4} lg={4} xl={3}>

                <Product product ={pro}/>
                <a>{pro.name}</a>
            </Col>

        ))}


        </Row>
    </>
  )
}

export default HomeScreen
